    "lostwood-and-district-4-a-easements-national-wildlife-refuges-september-december-1954",nt"isopen":
    false,nt"url": null,nt"notes": "This narrative report for Lostwood National
    Wildlife Refuge outlines Refuge accomplishments from September through December
    of 1954. The report begins by summarizing the weather conditions, water conditions,
    food and cover, and wildfires during this period. Wildlife- including migratory
    birds, upland game birds, big game animals, furbearers, predators, rodents, and
    raptors- is also covered. The Refuge development and maintenance section discusses
    physical developments and plantings. Resource management is outlined; topics include
    grazing, haying, and fur harvesting. A progress report on field investigations and
    applied research is also provided. The public relations section of the report describes
    recreational uses, Refuge visitors, Refuge participation, and hunting. Items of
    interest and photographs are attached.",nt"license_title": "License Not Specified",nt"extras":
